import { Option } from './option';
export class Question {
  constructor(data) {
    data = data || {};
    this.id = data.id;
    this.name = data.name;
    this.questionTypeId = data.questionTypeId;
    this.options = [];
    data.options.forEach(o => {
      this.options.push(new Option(o));
    });
  }
}
